q = group q by all;
q = foreach q generate "Today: " + toString(now(), "MMM dd, yyyy") + " | " + number_to_string(daysBetween(now(), quarter_last_day(now())),"##0") + " days left in quarter" as 'time';

current_user_quota_attainment.query:
opp = load "${App.Datasets.opportunity41_tp.FullyQualifiedName}";
opp = filter opp by 'IsClosed' == "true";
opp = filter opp by 'IsWon' == "true"; opp = filter opp by {{coalesce(cell(team_activities.selection, 0, "User_UniqueUserName"), cell(Current_User.selection, 0, "User_Name")).asEquality('User_Name')}}; 
quota = load "${App.Datasets.forecastingquota34_tp.FullyQualifiedName}"; quota = filter quota by {{coalesce(cell(team_activities.selection, 0, "User_UniqueUserName"), cell(Current_User.selection, 0, "User_Name")).asEquality("Quota_UniqueUserName")}}; 
result = cogroup opp by 'User_UniqueUserName' left, quota by 'Quota_UniqueUserName';
result = foreach result generate coalesce(opp.'User_UniqueUserName', quota.'Quota_UniqueUserName') as 'User_UniqueUserName', first(opp.'User_SmallPhotoUrl') as 'Photo', sum(opp.'Amount') as 'sum_Amount', sum(quota.'QuotaAmount') as 'sum_QuotaAmount', sum(opp.'Amount')/sum(quota.'QuotaAmount')*100 as 'sum_quota_attainment';
result = order result by 'User_UniqueUserName' asc;

top_performers_total_1.query:
q = load "${App.Datasets.opportunity41_tp.FullyQualifiedName}";
a = load "${App.Datasets.activities13_tp.FullyQualifiedName}";
q = filter q by 'IsClosed' == "true";
q = filter q by 'IsWon' == "true";
q = group q by 'User_UniqueUserName';
q = foreach q generate 'User_UniqueUserName' as 'User_UniqueUserName', sum('Amount') as 'sum_Amount', sum('Activity_ActivityCount') as 'ActivityCount';
q = order q by 'sum_Amount' asc;
q = limit q 3;
result = group q by 'User_UniqueUserName' left, a by 'User_UniqueUserName';
result = foreach result generate a.'User_UniqueUserName' as 'User', sum(a.'ActivityCount') as 'ActivityCount';
result = group result by all;
result = foreach result generate avg('ActivityCount') as 'avg_ActivityCount';

