kpi_pipe_coverage.query:
opp = load "${App.Datasets.opportunity41_tp.FullyQualifiedName}"; opp = filter opp by {{coalesce(cell(team_activities.selection, 0, "User_UniqueUserName"), cell(Current_User.selection, 0, "User_Name")).asEquality('User_Name')}};
won = filter opp by 'IsClosed' == "true";
won = filter won by 'IsWon' == "true";
q = load "${App.Datasets.forecastingquota34_tp.FullyQualifiedName}"; q = filter q by {{coalesce(cell(team_activities.selection, 0, "User_UniqueUserName"), cell(Current_User.selection, 0, "User_Name")).asEquality('Quota_UniqueUserName')}};
quota = group won by all full, q by all;
quota = foreach quota generate (case when sum(q.'QuotaAmount') - sum(won.'Amount') > 0 then sum(q.'QuotaAmount') - sum(won.'Amount') else 0 end) as 'remaining_quota';
open = filter opp by 'IsClosed' == "false";
open = group open by all full, quota by all;
coverage = foreach open generate round(coalesce(sum(open.'Amount') / sum(quota.'remaining_quota'), 0), 1) as 'sum_pipe_coverage';
